import React from "react";
import Navbar from "./essentials/Navbar";
import main_bg from "../images/main_bg.svg";
import Typewriter from "typewriter-effect";

export default function Home() {
  return (
    <>
      <title>Home</title>
      <img src={main_bg} class="background-image" />
      <div className="vh-100 d-flex justify-content-center align-items-center welcome-page">
        <center>
          <h1>
            <b>BrainTeaser : Where Minds Get Twisted and Logic Unleashed!</b>
          </h1>
          <h4>
            <Typewriter
              options={{
                strings: [
                  "Welcome to BrainTwister! \u{1F9E0}\u{1F525} The Ultimate Playground for Mind Benders!",
                  "Prepare to have your gray matter challenged! \u{1F637} Brainteasers await!",
                  "Put on your thinking caps and get ready to twist! \u{1F9E0}\u{1F4AD} Logic meets fun!",
                  "Embark on a journey of mental gymnastics! \u{1F938}\u{200D}\u{2642}\uFE0F Stretch your brain muscles!",
                  "Unleash your inner genius! \u{1F4A1} BrainTwister will blow your mind!",
                ],
                autoStart: true,
                loop: true,
              }}
            />
          </h4>
        </center>
      </div>
    </>
  );
}
